class Solution {
    fun leftmostBuildingQueries(heights: IntArray, queries: Array<IntArray>): IntArray {
        val n = heights.size
        val answer = IntArray(queries.size) { -1 }
        for ((index, query) in queries.withIndex()) {
            val (a, b) = query
            if (a >= b) {
                answer[index] = -1
            } else {
                var meet = false
                for (i in b downTo a + 1) {
                    if (heights[i] > heights[a] && heights[i] > heights[b]) {
                        answer[index] = i
                        meet = true
                        break
                    }
                }
                if (!meet) {
                    for (i in a + 1 until b) {
                        if (heights[i] > heights[a]) {
                            answer[index] = i
                            break
                        }
                    }
                }
            }
        }
        return answer
    }
}
